import withLayout from '../components/Layout'
import Link from 'next/link'

const PostLink = (props: any) => (
  <li>
    {
      console.log(typeof(props.title))
    }
    <Link href={`/p/:id`} as={`/p/${props.title}`}>
      <a>{ props.title }</a>
    </Link>
  </li>
)
const Page = () => (
  <div>
    <h1>Home Page</h1>
    <ul>
      <PostLink title="Hello Next.js"/>
      <PostLink title="Hello TypeScript"/>
      <PostLink title="Hello React"/>
    </ul>
  </div>
)

export default withLayout(Page)
